import React, { Component, useEffect, useState } from 'react';
import styles from './Offers.css';
import Carousel from "../../../components/Carousel/Carousel";
import PageHeader from '../../../components/PageHeader/PageHeader';
import { FooterContainer } from '../../../containers/footer';
import { getOfferDetails } from '../../../actions/offersAction';

const scrollToTravel = (id) => {
    const element = document.getElementById(id);
    element?.scrollIntoView({ behavior: 'smooth' });
};

const Offers = () => {
    const [allOffersWithDetails, setAllOffersWithDetails] = useState([]);
    const offerIDs = localStorage.getItem('allOfferIDs').split(',');

    useEffect(() => {
        const getAllOfferDetails = async () => {
            const offersWithDetails = await Promise.all(offerIDs.map(async (offer) => {
                const details = await getOfferDetails(offer);
                const data = {
                    offerID: details._id,
                    businessID: details.businessId,
                    description: details.description,
                    code: details.offerCode,
                    images: details.images,
                    startDate: details.startDate,
                    endDate: details.endDate,
                };
                return data;
            }));
            console.log(offersWithDetails)
            setAllOffersWithDetails(offersWithDetails);
        };
        getAllOfferDetails();
    }, []);

    return  (
        <div>
            <PageHeader/>
            <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.min.css"></link>
            <h3 className="text-center bg-gray-50 text-gray-800 py-20 text-3xl font-bold font-medium leading-tight text-5xl">Welcome, Ally Customer!</h3>

            <button onClick={()=>scrollToTravel('food')} className="button bg-blue-500 text-white font-bold py-2 px-4 rounded">Food & Drink</button>
            <button onClick={()=>scrollToTravel('home')} className="button bg-blue-500 text-white font-bold py-2 px-4 rounded">Home</button>
            <button onClick={()=>scrollToTravel('to-do')} className="button bg-blue-500 text-white font-bold py-2 px-4 rounded">Things To Do</button>
            <button onClick={()=>scrollToTravel('fashion')} className="button bg-blue-500 text-white font-bold py-2 px-4 rounded">Fashion</button>
            <button onClick={()=>scrollToTravel('beauty')} className="button bg-blue-500 text-white font-bold py-2 px-4 rounded">Beauty & Spas</button>
            <button onClick={()=>scrollToTravel('health')} className="button bg-blue-500 text-white font-bold py-2 px-4 rounded">Health & Fitness</button>
            <button onClick={()=>scrollToTravel('travel')} className="button bg-blue-500 text-white font-bold py-2 px-4 rounded">Travel</button>
            <button onClick={()=>scrollToTravel('more')} className="button bg-blue-500 text-white font-bold py-2 px-4 rounded">More</button>
            
            <div id="food" className="carousel">
                <h3 className="carousel-title text-center py-20 font-bold font-medium leading-tight text-3xl">Food & Drink</h3>
                <Carousel />
		    </div>
            <div id="home" className="carousel">
                <h3 className="carousel-title text-center py-20 font-bold font-medium leading-tight text-3xl">Home</h3>
                <Carousel />
		    </div>
            <div id="to-do" className="carousel">
                <h3 className="carousel-title text-center py-20 font-bold font-medium leading-tight text-3xl">Things To Do</h3>
                <Carousel />
		    </div>
            <div id="fashion" className="carousel">
                <h3 className="carousel-title text-center py-20 font-bold font-medium leading-tight text-3xl">Fashion</h3>
                <Carousel />
		    </div>
            <div id="beauty" className="carousel">
                <h3 className="carousel-title text-center py-20 font-bold font-medium leading-tight text-3xl">Beauty & Spas</h3>
                <Carousel />
		    </div>
            <div id="health" className="carousel">
                <h3 className="carousel-title text-center py-20 font-bold font-medium leading-tight text-3xl">Health & Fitness</h3>
                <Carousel />
		    </div>
            <div id="travel" className="carousel">
                <h3 className="carousel-title text-center py-20 font-bold font-medium leading-tight text-3xl">Travel</h3>
                <Carousel />
		    </div>
            <div id="more" className="carousel">
                <h3 className="carousel-title text-center py-20 font-bold font-medium leading-tight text-3xl">More</h3>
                <Carousel />
		    </div>
            <FooterContainer />
        </div>
    );
};


export default Offers;
